import React from 'react';
import { Image, StyleSheet, View } from 'react-native';

export default function NavigationBar() {
    return (
        <View style={styles.container}>
            <Image
                source={require('../../../assets/icons/file-signature-solid.png')}
            />
            <Image
                source={require('../../../assets/icons/envelope-solid.png')}
            />
            <Image
                source={require('../../../assets/icons/home-solid.png')}
            />
            <Image
                source={require('../../../assets/icons/hotel-solid.png')}
            />
            <Image
                source={require('../../../assets/icons/user-solid.png')}
            />
        </View>
    )
};

const styles = StyleSheet.create({
    container: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: 10,
        zIndex: 3,
        backgroundColor: '#D98236',
      },
});
